import './App.css';
import Banner from './components/Banner';
import Navbar from './components/Navbar';
import Products from './components/Products';
import ProductContextProvider from './Global/ProductContext';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Banner/>
      <ProductContextProvider>
        <Products/>
      </ProductContextProvider>
    </div>
  );
}

export default App;
